import React from "react";
import s from "./Account.module.css";


const Account = (props) => {
    

    return (
        <div className={s.account}>
            <div className={s.accountwrapper}>
                <div className={s.accountinfo}>
                    <div className={s.account_name}></div>
                </div>
            </div>
        </div>

    );
}

export default Account;
